// Sidebar Component
const Sidebar = ({ menuItems }) => {
  const styles = {
    sidebar: {
      width: '250px',
      background: 'linear-gradient(to bottom right, #064e3b, #276749)',
      color: 'white',
      padding: '20px',
      position: 'fixed',
      height: '100vh',
      boxShadow: '2px 0 15px rgba(0, 0, 0, 0.15)',
    },
    logo: {
      fontSize: '30px',
      marginBottom: '30px',
      fontWeight: 'bold',
      textAlign: 'center',
      cursor: 'pointer',
    },
    navList: {
      listStyle: 'none',
      padding: 0,
    },
    navItem: {
      display: 'flex',
      alignItems: 'center',
      padding: '15px 20px',
      color: 'white',
      textDecoration: 'none',
      borderRadius: '8px',
      marginBottom: '12px',
      transition: 'background-color 0.3s ease, transform 0.3s ease',
      cursor: 'pointer',
    },
    navIcon: {
      marginRight: '15px',
    },
  };

  return (
    <nav style={styles.sidebar}>
      <h2
        style={styles.logo}
        onMouseEnter={(e) => (e.target.style.transform = 'scale(1.1)')}
        onMouseLeave={(e) => (e.target.style.transform = 'scale(1)')}
      >
        Platform Logo
      </h2>
      <ul style={styles.navList}>
        {menuItems.map((item) => (
          <li key={item.path}>
            <a
              href={item.path}
              style={styles.navItem}
              onMouseEnter={(e) => (e.target.style.backgroundColor = '#3b6b5c')}
              onMouseLeave={(e) => (e.target.style.backgroundColor = '')}
            >
              <item.icon style={styles.navIcon} size={20} />
              {item.label}
            </a>
          </li>
        ))}
      </ul>
    </nav>
  );
};

// Hero Section
const Hero = () => {
  const styles = {
    hero: {
      background: 'linear-gradient(to bottom right, #2f855a, #276749)',
      color: 'white',
      padding: '50px',
      borderRadius: '12px',
      textAlign: 'center',
      marginBottom: '30px',
    },
    buttons: {
      display: 'flex',
      justifyContent: 'center',
      gap: '15px',
    },
  };

  return (
    <div style={styles.hero}>
      <h1>Transform Your ESG Reporting Process</h1>
      <p>
        Generate comprehensive ESG reports, track sustainability metrics, and
        make data-driven decisions with our powerful platform.
      </p>
      <div style={styles.buttons}>
        <button>Get Started</button>
        <button>Watch Demo</button>
      </div>
    </div>
  );
};

// Features Section
const Features = ({ features }) => {
  const styles = {
    featureCard: {
      flex: '1 1 calc(33% - 30px)',
      padding: '20px',
      backgroundColor: '#fff',
      borderRadius: '8px',
      boxShadow: '0 4px 10px rgba(0,0,0,0.1)',
      transition: 'box-shadow 0.3s ease',
      textAlign: 'center',
    },
  };

  return (
    <section>
      <h2>Why Choose Our Platform?</h2>
      <div style={{ display: 'flex', flexWrap: 'wrap', gap: '20px' }}>
        {features.map((feature, index) => (
          <div
            key={index}
            style={styles.featureCard}
            onMouseEnter={(e) =>
              (e.target.style.boxShadow = '0 6px 15px rgba(0,0,0,0.2)')
            }
            onMouseLeave={(e) =>
              (e.target.style.boxShadow = '0 4px 10px rgba(0,0,0,0.1)')
            }
          >
            <feature.icon size={40} />
            <h3>{feature.title}</h3>
            <p>{feature.description}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

// Stats Section
const Stats = ({ stats }) => {
  const styles = {
    stat: {
      textAlign: 'center',
    },
  };

  return (
    <section>
      <h2>Our Impact</h2>
      <div style={{ display: 'flex', gap: '20px' }}>
        {stats.map((stat, index) => (
          <div key={index} style={styles.stat}>
            <p>{stat.value}</p>
            <p>{stat.label}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

// Main LandingPage Component
const LandingPage = () => {
  return (
    <div style={{ display: 'flex' }}>
      <Sidebar menuItems={menuItems} />
      <main style={{ marginLeft: '250px', padding: '20px', flex: 1 }}>
        <Hero />
        <Features features={features} />
        <Stats stats={stats} />
      </main>
    </div>
  );
};

export default LandingPage;
